ng like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"https://demo.seothemes.com/studio-pro/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Features','','inherit','closed','closed','','6781-revision-v1','','','2020-07-31 05:36:48','2020-07-31 05:36:48','',6781,'http://alphaomegadigital.com.au/6781-revision-v1/',0,'revision','',0),(7132,1,'2020-07-31 05:36:48','2020-07-31 05:36:48','[gs_faq]','FAQs','Frequently asked questions','inherit','closed','closed','','1426-revision-v1','','','2020-07-31 05:36:48','2020-07-31 05:36:48','',1426,'http://alphaomegadigital.com.au/1426-revision-v1/',0,'revision','',0),(7133,1,'2020-07-31 05:36:48','2020-07-31 05:36:48','<p><strong>Want to see what a blockquote looks like?</strong></p>\n<blockquote><p>This is an example of a WordPress post, you could edit this to put information about your site so readers know where you are coming from. You can create as many posts as you like in order to share with your readers what is on your mind.</p></blockquote>\n<p><strong>Perhaps you’d like to see what an unordered list looks like?</strong></p>\n<ul>\n<li>Unordered list item #1</li>\n<li>Unordered list item #2</li>\n<li>Unordered list item #3</li>\n</ul>\n<p><strong>Or you’d prefer to see what an ordered list looks like?</strong></p>\n<ol>\n<li>Ordered list item #1</li>\n<li>Ordered list item #2</li>\n<li>Ordered list item #3</li>\n</ol>\n<p><strong>Care to see what