u are coming from. You can create as many pages like this one or sub-pages as you like and manage all of your content inside of WordPress.\r\n\r\nThis is an example of a WordPress page, you could edit this to put information about yourself or your site so readers know where you are coming from. You can create as many pages like this one or sub-pages as you like and manage all of your content inside of WordPress. This is an example of a WordPress page, you could edit this to put information about yourself or your site so readers know where you are coming from. You can create as many pages like this one or sub-pages as you like and manage all of your content inside of WordPress.\r\n\r\nThis is an example of a WordPress page, you could edit this to put information about yourself or your site so readers know where you are coming from. You can create as many pages like this one or sub-pages as you like and manage all of your content inside of WordPress.\r\n\r\n&nbsp;\r\n\r\n<a href=\"javascript:history.back()\" class=\"button\">Back to Demo</a> <a target=\"_blank\" href=\"https://seothemes.com/themes/studio-pro\" class=\"button gradient\" rel=\"noopener noreferrer\">Buy Studio Pro</a>','Landing Page','','inherit','closed','closed','','1078-revision-v1','','','2020-07-31 05:36:57','2020-07-31 05:36:57','',1078,'http://alphaomegadigital.com.au/1078-revision-v1/',0,'revision','',0),(7144,1,'2020-07-31 05:36:57','2020-07-31 05:36:57','\n	<h2 style=\"font-size: 70px; letter-spacing: 4px; text-align: center; font-weight: bold;\">Page Builder Demo</h2>\n	<h2 style=\"font-size: 20px; letter-spacing: 6px; text-align: center;\">Please note this page uses the Beaver Builder Pro plugin</h2>\n	<h2>Services</h2>\n	<p style=\"line-height: 28px; padding-bottom: 20px;\">Beaver Agency specializes in all types of online marketing and web design. We can handle most tasks in-house, but if needed, we have a huge network of talented people that we can take in on short notice.</p>\n<p style=\"line-height: 28px; padding-bottom: 20px;\">We take great pride in knowing our clients really well. So, before any project starts we do a very in-depth research of your company, product, services and of course, the competition. Knowing our clients 100%, we can come up with a business strategy and a project description that leaves no room for errors or mistakes. When your project is done, you know exactly what to expect and how to compete online.</p>\n	<a href=\"#team\" target=\"_self\" role=\"button\" rel=\"noopener noreferrer\">\n						Meet the team\n					</a>\n	<p style=\"text-align: center;\"><em>\"During the entire project, Beaver Agency was there to hold our hands. We ended up with an amazing online solution that our customers and ourselves value high\"</em></p>\n				<img src=\"http://beaveragency.demos.wpbeaverbuilder.com/wp-content/uploads/sites/11/2015/11/beaver-agency-personas-baily.jpg\" alt=\"beaver-agency-personas-baily\" itemprop=\"image\"  />\n	<h2 style=\"text-align: center; margin-top: -20px;\">Baily Simon</h2>\n<h4 style=\"text-align: center; margin-top: -19px;\">Lead Designer</h4>\n<p style=\"text-align: center;\">Baily is our lead designer. She has a creative vision like no one else. From the grand perspective and down to that 1x1 pixel, she excels. In her spare time, she loves to collect original vintage marketing materials from former East Germany.</p>\n				<img src=\"http://beaveragency.demos.wpbeaverbuilder.com/wp-content/uploads/sites/11/2015/11/beaver-agency-personas-emma.jpg\" alt=\"beaver-agency-personas-emma\" itemprop=\"image\"  />\n	<h2 style=\"text-align: center; margin-top: -20px;\">Emma Lee</h2>\n<h4 style=\"text-align: center; margin-top: -19px;\">UI Designer</h4>\n<p style=\"text-align: center;\">Emma knows a thing or two about buttons and sliders. She has studied user interaction for a decade and always knows how to tackle any given UI challenge. When not working with interface design, she rides her bike in her back garden.</p>\n				<img src=\"http://beaveragency.demos.wpbeaverbuilder.com/wp-content/uploads/sites/11/2015/11/beaver-agency-personas-alina.jpg\" alt=\"beaver-agency-personas-alina\" itemprop=\"image\"  />\n	<h2 style=\"text-align: center; margin-top: -20px;\">Alina Sweet</h2>\n<h4 style=\"text-align: center; margin-top: -19px;\">Project Manager</h4>\n<p style=\"text-align: center;\">If you have a question about your project, you ask Alina. Her desk might not indicate she is an organized person, but she is. Alina also has a sweet spot for vintage stuff and in her vacations she travels the Baltics to hunt down vintage toys from the 50\'s.</p>\n				<img src=\"http://beaveragency.demos.wpbeaverbuilder.com/wp-content/uploads/sites/11/2015/11/beaver-agency-personas-vince.jpg\" alt=\"beaver-agency-personas-vince\" itemprop=\"image\"  />\n	<h2 style=\"text-align: center; margin-top: -20px;\">Vince Summer</h2>\n<h4 style=\"text-align: center; margin-top: -19px;\">Founder and Developer</h4>\n<p style=\"text-align: center;\">Vince found our pet beaver Rufus wandering around the neighborhood looking for a place to live. That episode led to the idea of Beaver Agency and the rest is history. All waking hours, Vince and Rufus are on the road looking for Beaver Beauty Competitions - they haven\'t found one yet.</p>\n				<img src=\"http://beaveragency.demos.wpbeaverbuilder.com/wp-content/uploads/sites/11/2015/11/beaver-agency-personas-eric.jpg\" alt=\"beaver-agency-personas-eric\" itemprop=\"image\"  />\n	<h2 style=\"text-align: center; margin-top: -20px;\">Eric Hill</h2>\n<h4 style=\"text-align: center; margin-top: -19px;\">Lead Developer</h4>\n<p style=\"text-align: center;\">Eric makes it all happen. He always wanted to be an astronaut, but a leg injury killed that dream. Now he enjoys solving other missions for colleagues and clients. In his free time, he builds small rockets and teaches science in a youth club down town.</p>\n				<img src=\"http://beaveragency.demos.wpbeaverbuilder.com/wp-content/uploads/sites/11/2015/11/beaver-agency-personas-rufus.jpg\" alt=\"beaver-agency-personas-rufus\" itemprop=\"image\"  />\n	<h2 style=\"text-align: center; margin-top: -20px;\">Rufus</h2>\n<h4 style=\"text-align: center; margin-top: -19px;\">Pet Beaver</h4>\n<p style=\"text-align: center;\">Rufus likes to swim, sleep and eat carrots, and that\'s what he does. Rufus was once always running around our office, but now is always on the road with Vince 24/7/365.</p>\n	<h2 style=\"background: #F62963; display: inline-block; padding: 70px;\"><a href=\"http://beaveragency.demos.wpbeaverbuilder.com/project-page/\">Featured Project</a><br />\n<a href=\"http://beaveragency.demos.wpbeaverbuilder.com/project-page/\">Joybilly Branding</a></h2>\n				<img src=\"http://beaveragency.demos.wpbeaverbuilder.com/wp-content/uploads/sites/11/2015/11/blue-beaver-clients-3.png\" alt=\"blue-beaver-clients-3\" itemprop=\"image\"  />\n		<noscript>46</noscript>\n					DAMS BUILT\n		<noscript>3</noscript>\n					FEMALE BEAVERS\n		<noscript>2</noscript>\n					MALE BEAVERS\n','Page Builder','','inherit','closed','closed','','6782-revision-v1','','','2020-07-31 05:36:57','2020-07-31 05:36:57','',6782,'http://alphaomegadigital.com.au/6782-revision-v1/',0,'revision','',0),(7145,1,'2020-07-31 05:36:57','2020-07-31 05:36:57','','Sitemap','','inherit','closed','closed','','1341-revision-v1','','','2020-07-31 05:36:57','2020-07-31 05:36:57','',1341,'http://alphaomegadigital.com.au/1341-revision-v1/',0,'revision','',0),(7146,1,'2020-07-31 05:36:57','2020-07-31 05:36:57','[woocommerce_checkout]','Checkout','','inherit','closed','closed','','502-revision-v1','','','2020-07-31 05:36:57','2020-07-31 05:36:57','',502,'http://alphaomegadigital.com.au/502-revision-v1/',0,'revision','',0),(7147,1,'2020-07-31 05:36:57','2020-07-31 05:36:57','[woocommerce_my_account]','My Account','','inherit','closed','closed','','503-revision-v1','','','2020-07-31 05:36:57','2020-07-31 05:36:57','',503,'http://alphaomegadigital.co